import React, { useState, useEffect } from 'react';
import './App.css';

export default function App() {

    const [objectsArray, setObjectsArray] = useState([]);

    useEffect(() => {

        const randomUniqueId = (base, i) => { return '${base}-${i}' }

        const generateRandomObject = () => {
            setObjectsArray(objectsArray => {
                return [
                    ...objectsArray,
                    {ID: crypto.randomUUID(), name: '', description: '', colorIdentifier: ''}
                ]
            })
        }

        for (let i = 0; i <= 5; i++) {
            generateRandomObject();
        }

    }, []); //na konci prazdne pole, projde tedy pouze jednou pri page load



